const Contact = () => {

  return (
    <div id='contact'>
      <h1 className='contactPagetitle'>Contact Me</h1>
      <span className='contactDesc'>Please fill out the form below to discus any work opportunity.</span>

      <form className='ContactForm' >
        <input type="text" className='name' placeholder='Your Name'/>
        <input type="email" className='email' placeholder='Your Email'/>
        <textarea className='msg' name="message" rows="7" placeholder='Your Message'></textarea>
        <button type='submit' value='Send' className='submitBtn'>Submit</button>

        <div className="links">
            <c FaInstagram size={40} color="#ffffff" />
            <FaLinkedin size={40} color="#ffffff" />
        </div>
      </form>
    </div>
  )
}

export default Contact
